import React from 'react';
import {
  Card,
  CardActions,
  CardContent,
  Button,
  Typography,
  withStyles,
} from '@material-ui/core';
import { blue } from '@material-ui/core/colors';
import Head from 'next/head';

const ColoredButton = withStyles({
  root: {
    background: 'linear-gradient(45deg, #FE6B8B 30%, #FF8E53 90%)',
    borderRadius: 3,
    border: 0,
    color: 'white',
    height: 48,
    padding: '0 30px',
    boxShadow: '0 3px 5px 2px rgba(255, 105, 135, .3)',
  },
  label: {
    textTransform: 'capitalize',
  },
})(Button);

const Quiz = () => {
  return (
    <>
      <Head>
        <link rel="stylesheet" href="/pages/quiz/styles.css" />
      </Head>
      <div style={{ backgroundColor: blue[300] }} className="background">
        <Card className={['card']}>
          <CardContent>
            <Typography className={['card-title']} gutterBottom>
              Que tipo de empreendedor é você durante a crise?
            </Typography>
            <hr />
            <p id="question"></p>
            <form id="answers" action="#"></form>
          </CardContent>
          <CardActions>
            <p id="question"></p>
            <form id="answers" action="#"></form>
          </CardActions>
          <div className={['card-footer']}>
            <hr />
            <ColoredButton
              variant="contained"
              color="blue"
              className={['button']}
            >
              Próxima Pergunta
            </ColoredButton>
          </div>
        </Card>
      </div>
    </>
  );
};

export default Quiz;
